import React from 'react'
import { FaShoppingCart } from "react-icons/fa";


const Navbar = () => {
  return (
    <div className="flex flex-row justify-between">
      <img src='https://www.google.com/url?sa=i&url=https%3A%2F%2Fecomzy-shopping-cart.vercel.app%2F&psig=AOvVaw392G-YkYuoV23Figoif54z&ust=1726859484638000&source=images&cd=vfe&opi=89978449&ved=0CBQQjRxqFwoTCKC6vfjaz4gDFQAAAAAdAAAAABAE'/>

      <div>
        <p>Home</p>

        <FaShoppingCart />


      </div>
    </div>
  )
}

export default Navbar
